import React from "react";
import { useState } from 'react';
import { Link } from 'react-router-dom';
import { makeStyles } from "@material-ui/core/styles";
import { FaLinkedin } from 'react-icons/fa';
import Button2 from '@mui/material/Button';
import Stack from '@mui/material/Stack';
import SendIcon from '@mui/icons-material/Send';
import { styled } from '@mui/material/styles';
import { TypeAnimation } from 'react-type-animation';
import { green } from '@mui/material/colors';
import imageList1 from './imageList';
import breadc from './breadc';
import mt from './MT.svg';
import mth from './mth.svg';
import ok from './ok22.svg';
import { emphasize } from '@mui/material/styles';
import Breadcrumbs from '@mui/material/Breadcrumbs';
import Chip from '@mui/material/Chip';
import HomeIcon from '@mui/icons-material/Home';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';




import { AppBar, Toolbar, Typography, Button, Grid, Paper } from "@material-ui/core";



const StyledBreadcrumb = styled(Chip)(({ theme }) => {
  const backgroundColor =
    theme.palette.mode === 'light'
      ? theme.palette.grey[100]
      : theme.palette.grey[800];
  return {
    backgroundColor,
    height: theme.spacing(3),
    paddingRight: 100,
    color: theme.palette.text.primary,
    fontWeight: theme.typography.fontWeightRegular,
    '&:hover, &:focus': {
      backgroundColor: emphasize(backgroundColor, 0.06),
    },
    '&:active': {
      boxShadow: theme.shadows[1],
      backgroundColor: emphasize(backgroundColor, 0.12),
    },
  };
}); // TypeScript only: need a type cast here because https://github.com/Microsoft/TypeScript/issues/26591

function handleClick(event) {
  event.preventDefault();
  console.info('You clicked a breadcrumb.');
}
const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },

  appBar: {
    backgroundColor: theme.palette.background.paper,
    // borderBottom: "1px solid pink", 
    boxShadow: "none",
    fontFamily: 'Montserrat',
    fontSize: 150,
    left: 20,
  },
  centerButtons: {
    display: "flex",
    alignItems: "center",
  },
  links:{
    fontSize: 14,
    textAlign: 'center',
    left: 450,

  },
  title: {
    flexGrow: 1,
    paddingLeft: '50%',
    fontWeight: "bold",
    color: "black",
    fontFamily: 'Montserrat',

  },
  container: {
    position: 'absolute', // Position the SVG absolutely within its container
    right: '600px', // Adjust this value for the desired right margin
    top: '50%', // Center the SVG vertically
    transform: 'translateY(-50%)', // Adjust to vertically center the SVG
    maxWidth: '100%', // Adjust the maximum width as needed
    height: 'auto', // Maintain the aspect ratio
  },
  svgImage: {
    marginTop: -200,
    marginLeft: 1000,
    maxWidth: 2000, // Make sure SVG doesn't exceed container width
    height: 'auto', // Maintain aspect ratio
  },
  summarySection: {
    marginTop: 100,
    marginLeft: 50,
    padding: theme.spacing(3),
    fontFamily: 'Montserrat',
    fontSize: 120,
    fontWeight: 20,
    animation: "type 4s steps(60, end)",

  },
  logoButton: {
    marginRight: theme.spacing(2),
    position: 'absolute',
    width: '110px',
    height: '110px',
  },
  top: {
    // marginTop: 275,
    // marginLeft: 305,
    marginLeft: 105,
    marginTop: 275,
    padding: theme.spacing(2),
    fontFamily: 'Montserrat',
    fontSize: 24,
    width: 700,
    fontWeight: 20,
    animation: "type 4s steps(60, end)",

  },
  bottom: {
    marginLeft: 100,
  },
  comment: {
    marginTop: -600,
    marginLeft: 700,
    padding: theme.spacing(1),
    fontFamily: 'Montserrat',
    fontSize: 30,
    fontWeight: 20,

  },
  interactiveArt: {
    marginTop: -70,
    width: 100,
    height: '100%',
  },
  linkedinButton: {
    marginTop: -3,
    left: 450,

  },
  svgc: {
    marginTop: -50,
    marginLeft: 450,
    width: '100px',
    height: '100px',

    /* Add more styling as needed */
  },
}));

const Homepage = () => {
  const classes = useStyles();

  const [linkedinUrl] = useState('https://www.linkedin.com/in/micatonge');

  const handleLinkedinClick = () => {
    window.open(linkedinUrl, '_blank');
  };

  const ColorButton = styled(Button)(({ theme }) => ({
    color: theme.palette.getContrastText(green[700]),
    marginLeft: 120,

    backgroundColor: green[700],
    '&:hover': {
      backgroundColor: green[800],
    },
  }));

  return (

    <div className={classes.root}>
      <AppBar position="static" className={classes.appBar}>
        <Toolbar >
          <Button component={Link} to="/"> <img src={mt} alt="Logo" className={classes.logoButton} /></Button>
          <Button className={classes.links} component={Link} to="/about">About Me</Button>
          <Button className={classes.links} component={Link} to="/projects">Projects</Button>
          <Button className={classes.links} component={Link} to="/resume">Resume</Button>
          <Button className={classes.links} component={Link} to="/contact">Contact Me</Button>
          <Button className={classes.linkedinButton} onClick={handleLinkedinClick}>
            <FaLinkedin size={20} />
          </Button>
          {/* <Typography variant="h6" className={classes.title}>
            Mica Tongemt
          </Typography> */}
        </Toolbar>
      </AppBar>
      <Grid container>
        <Grid item xs={12} md={10}>
        <div className={classes.svgc}>
        <img src={mth} alt="SVG Image" />
      </div>
            <Typography  className={classes.top} variant="h6">Brooklyn-based Software Engineer passionate about the blend of Computer Science and Design. âœ»</Typography>
            {/* <Typography id="fadeout" className={classes.comment} variant="h1"> you can find me coding . . .</Typography> */}
            <Stack direction="row" spacing={2}>
      <ColorButton variant="contained" endIcon={<SendIcon />}>
  Hire me
</ColorButton>
      <ColorButton variant="contained" href="#contained-buttons">
        Link
      </ColorButton>
    </Stack>
    < breadc />
    <div role="presentation" onClick={handleClick}>
      <Breadcrumbs aria-label="breadcrumb">
        <StyledBreadcrumb
          component="a"
          href="#"
          label="Home"
          icon={<HomeIcon fontSize="small" />}
        />
        <StyledBreadcrumb component="a" href="#" label="Catalog" />
        <StyledBreadcrumb
          label="Accessories"
          deleteIcon={<ExpandMoreIcon />}
          onDelete={handleClick}
        />
      </Breadcrumbs>
    </div>
    <img src={ok} alt="Your SVG" className={classes.svgImage} />

        </Grid>

        {/* <Grid item xs={2} md={3} className={classes.interactiveArt}>
        <img src={flower} alt="logo" />
        </Grid> */}
      </Grid>
    </div>
  );
};

export default Homepage;
